import Link from 'next/link';

const Header = () => (
	<React.Fragment>
		<header  className="header header-1">
			<div className="topbar">
				<div className="container">
					<div className="row align-items-center">
						<div className="col-sm-8 col-md-6">
							<div className="info">
								<div className="info-item">
									<i className="fa fa-phone"></i> +62 7144 3300
								</div>
								<div className="info-item">
									<i className="fa fa-envelope-o"></i> <a href="mailto:support@kids.com" title="">support@kids.com</a>
								</div>
							</div>
						</div>
						<div className="col-sm-4 col-md-6">
							<div className="sosmed-icon pull-right d-inline-flex">
								<a href="#"><i className="fa fa-facebook"></i></a> 
								<a href="#"><i className="fa fa-twitter"></i></a> 
								<a href="#"><i className="fa fa-instagram"></i></a> 
								<a href="#"><i className="fa fa-linkedin"></i></a> 
							</div>
						</div>
					</div>
				</div>
			</div>
			<div className="navbar-main">
				<div className="container">
					<nav id="navbar-example" className="navbar navbar-expand-lg">

			        	<a href="/" className="navbar-brand">
							<img className="abc-logo" src="abi_logo.png" alt="" />
						</a>

				        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
				            <span className="navbar-toggler-icon"></span>
				        </button>
				        <div className="collapse navbar-collapse" id="navbarNavDropdown">
				            <ul className="navbar-nav ml-auto">
				            	<li className="nav-item active">
				                    	<a href="/" className="nav-link">HOME</a>
				                </li>
				            	<li className="nav-item">
				                    	<a href="/about" className="nav-link">ABOUT US</a>
				                </li>
				            	<li className="nav-item">
				                    <a href="/blog" className="nav-link">BLOG</a>
				                </li>
				            	<li className="nav-item">
				            		<Link href="/services">
				                    	<a className="nav-link">SERVICES</a>
				                    </Link>
				                </li>

				            	<li className="nav-item">
				                    	<a href="/contact" className="nav-link">CONTACT US</a>
				                </li>
				                <li className="nav-item">
				                    	<a href="/admin/login" className="nav-link">Login</a>
				                </li>
				            </ul>
				        </div>
				    </nav>
				</div> 
			</div>
		</header>



		 <style jsx global>{`
		  .navbar-brand{
	      	padding-top: 0;
		  }

		  .topbar{
	          background-color: #fd008f !important;
	        }


	      .nav-link:hover {
	      	color: #fd008f !important;
	      }

	      .header-1 .navbar-main .active > .nav-link {
	      	background-color: #f1c22e !important;
	      }

	      .header-1 .navbar-main .active > .nav-link:hover {
	      	background-color: transparent !important;
	      }

	      .bd-placeholder-img:after{
	      	content:"";
			display:block;
			position:absolute;
			top:0;
			bottom:0;
			left:0;
			right:0;
			background:rgba(0,0,0,0.6);
	      }



	    `}</style>

    </React.Fragment>

);

export default Header;

